import { Box, Flex, Text, Button, Stack, useDisclosure } from "@chakra-ui/react";
import  {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
  } from 'react-router-dom'

const NavItem = () => {
    return (
        <>
        <Stack>
                      <Link >
                     <Text ml="20px"  mt="20px"fontWeight="700" fontSize="18px" color="gray">
                        My profile      
                    </Text>
                    </Link>
                      </Stack>
        </>
    )
}

export default NavItem
